import app from "../images/android.jpg";
import cloud from "../images/cloud.jpg";
import web from "../images/web.jpg";
import programming from "../images/python.jpg";
import ml from "../images/machine.jpg";
import digital from "../images/digital.jpg";

const Sdata =[
    {
        imgsrc: web,
        title: "Web Development",
        text:"\"Website without visitors is like a ship lost in the horizon...\"",
    },
    {
        imgsrc: app,
        title: "Android Development",
        text:"\"In my opinion,the future of mobile is the future of everything...\"",
    },
    {
        imgsrc: digital,
        title: "Digital Marketing",
        text: "\"It's hard to find things that won't sell online...\"",
    },
    {
        imgsrc: ml,
        title: "Machine Learning",
        text:"\"Computers are able to see,hear and learn. Welcome to the future...\"",
    },
    {
        imgsrc: programming,
        title: "Software Development",
        text:"\"Walking on water and developing software from a specfiction are easy if both are frozen...\"",
    },
    {
        imgsrc: cloud,
        title: "Cloud Computing",
        text:"\" Cloud is about how you do computing, not where you do computing...\"",
    },
];
export default Sdata;
